css:
@-moz-document url-prefix("https://app.spare5.com/fives"), url-prefix("https://app.spare5.com/v1")
{
  .container-fluid, .tasks-grid-container, .fivesweb-referrals-container, .fivesweb-skills-container, .payments-charities-container, body, footer
  {
    background-color: #1b1b1b !important;
    background-image: url(data:image/png;base64,) !important;
    background-clip: border-box !important;
    background-origin: padding-box !important;
    background-attachment: fixed !important;
    background-repeat: repeat !important;
    background-size: auto !important;
    background-position: left top !important;
  }

  .task-state-header
  {
    color: #ececec !important;
  }

  .fivesweb-top-bar
  {
    background-color: #1d1d1d !important;
  }

  .swell-theme.green-theme a, .swell-theme.green-theme a
  {
    color: #e6e6e6 !important;
  }

  .task-title
  {
    color: #d7d9dc !important;
    background: #272727 !important;
    border-bottom: 1px solid #272727 !important;
  }

  .task-item
  {
    cursor: pointer !important;
    border: 1px solid #212121 !important;
    background-color: #1b1b1b !important;
  }

  .task-description
  {
    color: #a5a7ab !important;
  }

  .task-details-container .xp-description
  {
    color: #d8d1d1 !important;
  }

  .profile-dropdown-container .profile-dropdown-row .profile-dropdown-details h3
  {
    color: #ffffff !important;
  }

  .profile-snippit-container .profile-snippit .profile-snippit-data
  {
    color: #1c84c6 !important;
  }

  .profile-logout-container .profile-logout-button
  {
    border: 1px solid #424242 !important;
    color: #fb1528 !important;
    background-color: #1b1b1b !important;
  }

  body
  {
    color: #dadada !important;
  }

  .profile-dropdown-container
  {
    background-color: #212020 !important;
    border: 1px solid #131111 !important;
  }

  .profile-snippit-container .profile-snippit .profile-snippit-data.profile-snippit-purse
  {
    color: #3ac459 !important;
  }

  a
  {
    color: #e4e4e4 !important;
  }

  .task-master-task
  {
    background-color: #1c84c6 !important;
  }

  .support-dropdown-container
  {
    background-color: #212020 !important;
    border: 1px solid #444444 !important;
  }

  .support-dropdown-container li p
  {
    color: #ffffff !important;
  }

  .community-modal-contents
  {
    color: #ffffff !important;
    background-color: #151515 !important;
  }

  .small-five-profile .five-profile-name
  {
    color: #e6e6e6 !important;
  }

  .user-referrals .referral-row
  {
    border-bottom: 1px solid #303233 !important;
  }

  .ibox-content
  {
    background-color: #1b1b1b !important;
    border-color: #191919 !important;
  }

  .five-profile
  {
    background-color: #191616 !important;
  }

  .five-profile .five-profile-generic-lockup, .five-profile .five-profile-forum-posts, .five-profile .five-profile-total-xp, .five-profile .five-profile-pic-lockup, .five-profile .skill-title
  {
    color: #eaeaea !important;
  }

  .five-profile .skill-container .skill-level
  {
    color: #ffffff !important;
  }

  .five-profile .skills-rule .skills-rule-text
  {
    color: #10bcff !important;
  }

  .ibox-title
  {
    background-color: #272727 !important;
    border-color: #444444 !important;
  }

  .table-striped > tbody > tr:nth-of-type(odd)
  {
    background-color: #2d2b2b !important;
  }

  .form-control, .single-line
  {
    background-color: #2d2b2b !important;
    border: 1px solid #2d2b2b !important;
  }

  .input-group-addon
  {
    background-color: #2d2b2b !important;
    border: 1px solid #2d2b2b !important;
  }

  .btn-default
  {
    background-color: #0b9c2b !important;
    border-color: #1f1d1d !important;
  }

  .btn-primary
  {
    background-color: #0b9c2b !important;
    border-color: #1f1d1d !important;
  }

  .fivesweb-top-bar .fivesweb-top-bar-navbar-brand
  {
    background: #0b9c2b !important;
  }

  .fivesweb-top-bar
  {
    border-bottom: 1px solid #272629 !important;
    -webkit-box-shadow: 1px 2px 4px #6c6e6f !important;
  }

  .alert-info
  {
    color: #d0d0d0 !important;
    background-color: #3e3d3d !important;
    border-color: #212020 !important;
  }

  .contact .content
  {
    background-color: #2d2d2d !important;
  }

  .form-control input, .form-control select, .form-control textarea
  {
    border: 1px solid #5f5f5f !important;
    color: #e2e2e2 !important;
  }

  .modal .search-actions, .modal.main, .modal.main>.search-form, .modal.searchbox
  {
    background-color: #2d2d2d !important;
  }

  hr
  {
    border-top: 1px solid #505050 !important;
  }

  .table > thead > tr > th
  {
    border-bottom: 1px solid #505050 !important;
  }

  .forum-category .title
  {
    color: #dcdcdc !important;
  }

  .forum-category .description
  {
    color: #989898 !important;
  }

  .forum-discussion .title
  {
    color: #dcdcdc !important;
  }

  .forum-discussion .first-message
  {
    color: #989898 !important;
  }

  .forum-category
  {
    border-bottom: 1px solid #404142 !important;
  }

  .forum-discussion .poster, .forum-discussion .count, .forum-discussion .last-update, .forum-discussion .pinned
  {
    color: #abb4b7 !important;
  }

  .forum-discussion .not-hot
  {
    color: #4CAF50 !important;
  }

  .forum-message
  {
    color: #adadad !important;
  }

  .discussions-view .text-input
  {
    border: 1px solid #403b3b !important;
    background-color: #313030 !important;
    color: #d6d6d6 !important;
  }

  .discussions-view .text-area
  {
    border: 1px solid #403b3b !important;
    background-color: #313030 !important;
    color: #d6d6d6 !important;
  }

  .discussions-view .btn
  {
    background-color: #4a4747 !important;
  }

  .forum-breadcrumb
  {
    color: #e4e4e4 !important;
  }

  .add-message-container .text-area
  {
    border: 1px solid #403b3b !important;
    background-color: #313030 !important;
    color: #d6d6d6 !important;
  }

  .ibox .open > .dropdown-menu
  {
    background-color: #313030 !important;
  }

  .forum-message .stroke
  {
    background-color: #636363 !important;
  }

  .community-at-replies-dropdown-container
  {
    border: 1px solid #313030 !important;
    background: #272629 !important;
  }

  .label-list-container .label-list-search .label-list-search-input
  {
    background-color: rgba(63, 64, 66, 0.5) !important;
  }

  .swell-modal
  {
    background-color: #151515 !important;
    border: 1px solid #1e1f1f !important;
  }

  .swell-overlay
  {
    background-color: rgba(0, 0, 0, 0.5) !important;
  }

  .swell-modal .swell-title
  {
    color: #b3b3b3 !important;
  }

  .swell-modal .swell-content
  {
    color: #a7a7a7 !important;
  }

  .instructions-panel .instructions-panel-content .instructions-panel-updated-date
  {
    color: #000000 !important;
  }

  .community-instructions-container .instructions-page-indicator-container .instructions-page-indicator.active-page
  {
    background: #09da11 !important;
  }

  .community-instructions-container .instructions-page-indicator-container .instructions-page-indicator
  {
    background: #b5b5b5 !important;
  }

  .cv-segment-menu-item-information-window
  {
    background-color: rgba(14, 14, 14, 0.9) !important;
  }

  .cv-padding-wrapper
  {
    background-color: #1b1b1b !important;
  }

  .action-prompt-panel.action-prompt-panel-with-background
  {
    background-color: rgba(14, 14, 14, 0.8) !important;
  }

  .label-list-container
  {
    background-color: rgba(14, 14, 14, 0.8) !important;
  }

  .label-list-container .label-list-header
  {
    background-color: rgba(58, 58, 58, 0.5) !important;
    color: #eaeaea !important;
  }

  .label-list-container .label-list-item
  {
    background-color: rgba(14, 14, 14, 0.4);
  }

  .cv-bottom-tools
  {
    background: rgba(14, 14, 14, 0.8) !important;
  }

  .cv-bottom-tools .cv-bottom-tools-header
  {
    background-color: rgba(58, 58, 58, 0.5) !important;
  }

  .annotation-image-box
  {
    background-color: #1b1b1b !important;
  }

  .fivesweb-action-btn.secondary-btn
  {
    color: #d4d4d4 !important;
    background-color: #4c4d4e !important;
  }

  .shortcut-help-container .shortcut-help-row .shortcut-help-description
  {
    color: #d6d6d6 !important;
  }

  .shortcut-help-container .shortcut-help-row .shortcut-help-key-container .shortcut-help-key
  {
    color: #dedede !important;
    border: 1px solid #adadad !important;
  }

  .cv-action-prompt
  {
    background-color: rgba(14, 14, 14, 0.8) !important;
  }

  .job_box
  {
    background-color: #1e1f1f !important;
  }

  div.image-box
  {
    background-color: #1e1f1f !important;
  }

  .collapse.in
  {
    background-color: #1e1f1f !important;
  }

  .modal-header
  {
    border-bottom: 1px solid #4c4a4a !important;
  }

  .reward-body
  {
    background-color: #131111 !important;
  }

  .reward-box
  {
    background-color: #212020 !important;
  }

  .clickable-box
  {
    background-color: #212020 !important;
  }

  .fa-3x
  {
    background-color: #212020 !important;
  }

  .clickable-box p
  {
    color: #adadad !important;
  }

  .donemodal
  {
    background: linear-gradient(to top, #131111, #4c4a4a) !important;
  }

  .reward-box h3
  {
    color: #adadad !important;
  }

  .reward-box h4
  {
    color: #adadad !important;
  }

  [type=radio].rateme:checked + label:before
  {
    background-color: #e6e6e6 !important;
    color: #0b9c2b !important;
  }

  .reward-header
  {
    color: #d6d6d6 !important;
  }

  .reward-card .reward-chart-subtitle.min-pay-subtitle
  {
    color: #cacaca !important;
  }

  h2
  {
    color: #d5d5d5 !important;
  }

  .text-danger
  {
    color: #f72215 !important;
  }

  .text-success
  {
    color: #15a4ff !important;
  }

  .refer-title-subtext
  {
    color: #8e8e8e !important;
  }

  .swell-modal .icon-close-modal
  {
    color: #c8cacc !important;
  }

  .community-modal-contents .modal-secondary-button
  {
    color: #d4d4d4 !important;
    background-color: #4c4d4e !important;
  }

  .problem-header
  {
    color: #d0d0d0 !important;
  }

  fieldset
  {
    color: #b3b3b3 !important;
  }

  .sentiment-container
  {
    color: #b3b3b3 !important;
  }

  .problem-textarea
  {
    border: 1px solid #403b3b !important;
    background-color: #313030 !important;
    color: #d6d6d6 !important;
  }

  img.selected-emotion
  {
    border: 2px solid #17ca1e !important;
  }

  .login-buttons a
  {
    background-color: #2b2b2b !important;
  }

  #emailLogin
  {
    color: #e3e3e3 !important;
    background-color: #2b2b2b !important;
  }

  .alert-warning
  {
    color: #e4e4e4 !important;
    background-color: #2b2b2b !important;
    border-color: #383838 !important;
  }
}
